CREATE schema merchant; 


CREATE TABLE
    merchant.dim_postcode_new
    (
        postcode INTEGER NOT NULL,
        state CHARACTER VARYING(10) NOT NULL,
        postcode_name CHARACTER VARYING(60) NOT NULL,
        dscrptn CHARACTER VARYING(60),
        multi_sbrb CHARACTER(1),
        PRIMARY KEY (postcode, state, postcode_name)
    );
CREATE INDEX  ON merchant.dim_postcode_new USING btree (upper((postcode_name)));
CREATE INDEX ON merchant.dim_postcode_new USING btree (postcode_name);
CREATE INDEX ON merchant.dim_postcode_new USING btree (postcode);
CREATE INDEX ON merchant.dim_postcode_new USING btree (multi_sbrb);
